function ExpensesDate() {
  const month = props.date.toLocaleString("zh-TW", { month: "long" });
  const year = props.date.getFullYear();
  const day = props.date.toLocaleString("zh-TW", { day: "2-digit" });

  return (
    <div>
      <div>{month}</div>
      <div>{year}</div>
      <div>{day}</div>
    </div>
  );
}

export default ExpensesDate;
